// import styles from './PersonInfo.module.css';

const PersonInfo = ({pesonInfo}) => {
    return (
        <>
            <ul>
                {personInfo.map(({title, data}) => (
                    data && (<li key={title}>
                        <span>{title}: {data}</span>
                        </li>)
                    ))}
            </ul>
        </>
    );
}

PersonInfo.propTypes = {
    personInfo: PropTypes.array,
}

export default PersonInfo;
